import React from 'react';
import classes from './ToDoList.module.scss';



const ToDoItem = ({ todo, index=1 }) => {
    return (
        <div className={classes.toDoItem}>
            <strong>{index+=1}</strong>
            <li>{todo.title}</li>
        </div>
    )
}

export default ToDoItem;
